const Header = () => {
    return (
      <div className="header">
        <div className="Logo-Container">
          <img
            className="logo"
            src="data:image/png;base64,"
            alt="FoodDelivery"
          />
        </div>
        <div className="nav-Items">
          <ul>
            <li>Home</li>
            <li>About Us</li>
            <li>Contact Us</li>
            <li>Cart</li>
          </ul>
        </div>
      </div>
    );
  };

  export default Header;
